package top.jacktu.page.bean;import java.io.Serializable;public class Jfile implements Serializable {	private static final long serialVersionUID = -8984517207543842745L;	private int id;	private String uploader;	private String name;	private String localname;	private long size;	private String annotation;	private String link;	private String path;	public String toString() {		return "Jfile [id=" + this.id + ", uploader=" + this.uploader + ", name=" + this.name + ", localname="				+ this.localname + ", size=" + this.size + ", annotation=" + this.annotation + ", link=" + this.link				+ ", path=" + this.path + "]";	}	public String getName() {		return this.name;	}	public void setName(String name) {		this.name = name;	}	public String getAnnotation() {		return this.annotation;	}	public void setAnnotation(String annotation) {		this.annotation = annotation;	}	public static long getSerialversionuid() {		return -8984517207543842745L;	}	public String getPath() {		return this.path;	}	public void setPath(String path) {		this.path = path;	}	public int getId() {		return this.id;	}	public void setId(int id) {		this.id = id;	}	public String getLink() {		return this.link;	}	public void setLink(String link) {		this.link = link;	}	public String getUploader() {		return this.uploader;	}	public void setUploader(String uploader) {		this.uploader = uploader;	}	public long getSize() {		return this.size;	}	public void setSize(long size) {		this.size = size;	}	public String getLocalname() {		return this.localname;	}	public void setLocalname(String localname) {		this.localname = localname;	}}